webpackJsonp([0xcd7465a3f583],{3822:function(e,t){e.exports={data:{markdownRemark:{html:'<p>mkm氏の製作なされたフリーウェア「東方弾幕風」にて動作するスクリプトのEmEditor用開発支援ツールです。この構文ファイルをインストールすると東方弾幕風スクリプトの組み込み関数・定数などが強調され、恐らくメモ帳で組むよりプログラミングしやすくなると思います。この構文ファイル1つでステージスクリプトから単発スクリプト、会話イベントから自機スクリプトやユーザー定義グラフィック弾スクリプトまで全て対応しております。  東方弾幕風Version0.12mスクリプトに準拠しています。(元々は<a href="/!/thA/">東方時封城</a>のスクリプト組む上で出来た副産物だってことはここだけの秘密でｗ)</p>\n<ul>\n<li>\n<p>“<a href="/filez/thd/EmDnh.zip">EmEditor用弾幕風構文ファイル”をダウンロードする</a> ([filesize]<a href="https://danmaq.com/filez/thd/EmDnh.zip%5B/filesize%5D">https://danmaq.com/filez/thd/EmDnh.zip[/filesize]</a>)</p>\n</li>\n<li>\n<p><a href="http://www.emurasoft.com/jp/">EmEditorを入手する</a></p>\n<h2>更新履歴</h2>\n</li>\n<li>\n<p>(2006/11/8)組み込み関数“DeleteEnemyShotImmediatelyInCircle”が強調されていなかったのを修正</p>\n</li>\n<li>\n<p>(2006/10/15)組み込み命令“times”及び組み込み関数“GetPlayerScriptName”が強調されていなかったのを修正、組み込み関数“ClearByteCodeCash”をもう古い名前とみなし別色で強調するようにした</p>\n</li>\n</ul>',frontmatter:{cover:null,date:"2005-03-23T00:00:00+09:00",strDate:"2005/3/22",title:"EmEditor用弾幕風構文ファイル"}}},pathContext:{path:"/ja/blog/2005/03/23-emeditor-danmakufu/",langKey:"ja"}}}});
